  \"litchfield-wetland-management-district-annual-narrative-report-calendar-year-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Litchfield
  WMD outlines accomplishments during the 1986 calendar year. The report begins with
  a summary of the year's highlights and weather conditions. Land acquisition is covered.
  The report includes a planning section which discusses the master plan, public participation,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Administration is outlined; information about personnel, youth programs, manpower
  programs, volunteer programs, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, croplands, grasslands,
  grazing, haying, fire management, pest control, and WPA easements. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, surplus
  animal disposal, and animal control. The public uses of the described in this report
  include interpretive programs, hunting, fishing, trapping, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, computer systems, and energy conservation. Cooperative programs and items
  of interest are provided at the end. Brochures, newspaper articles, and field guides
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
